t_ciclo desenha_icone(t_ciclo ciclinho, int x, int y, char nome[]){
	int i = 0;

	while (i < 4) {
		
		if (nome[0] == ciclos_array[i].nome[0]) {
			break;
		}
		
		i++;
	}
	
	ciclinho.pos_x = x;
	ciclinho.pos_y = y;
	ili9488_set_foreground_color(COLOR_CONVERT(COLOR_WHITE));
	ili9488_draw_pixmap(x, y, ciclos_array[i].icone->width, ciclos_array[i].icone->height, ciclos_array[i].icone->data);

	return ciclinho;
}

